  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of 15 centimeter
  and 30 centimeter pixel resolution, natural color orthoimages covering the urban
  area footprint. An orthoimage is remotely sensed image data in which displacement
  of features in the image caused by terrain relief and sensor orientation have been
  mathematically removed. Orthoimagery combines the image characteristics of a photograph
  with the geometric qualities of a map. The design accuracy is estimated not to exceed
  3-meter diagonal RMSE (2.12m RMSE in X or Y). Each orthoimage provides imagery over
  a 1500-meter by 1500-meter block on the ground. There is no image overlap between
  adjacent files. The projected coordinate system is UTM with a NAD83 datum. The naming
  convention is based on the U. S. National Grid (USNG), taking the coordinates of
  the SW corner of the orthoimage.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
